from pylab import *
import random as pyrandom
import ocrolib.lstm
from functools import partial

net = ocrolib.lstm.LSTM1(5,2,2)
net.setLearningRate(1e-1)

def generate_mod(n=20, ninput=5, m=3, examples=0) :
	x = rand(n, ninput)
	y = []
	for elem in x :
		if elem[0] > elem[1] :
			y.append([1.0])
		else :
			y.append([0.0])

	return x,y


